description:
A match made in heaven: Igorrr, well known for the madness of multi-instrumental epic breakcore, pairs up with Ruby My Dear, one of the finest and most imaginative producers of the genre. The result is an intense EP which seamlessly combines these two musicans' own sounds and takes the listener on an impressive trip. Hardcore beats, metal riffs, growls, opera vocals, sub-basses, absurd samples, sudden breaks: all these and more are found in &quot;Maigre&quot;, not thrown aimlessly, but carefully wrought in an EP which might advance a whole music scene forward.
